const _fonts = [{
    'font-family': 'Courier Prime',
    src: `data:@file/x-font-ttf;base64,`,
    'font-weight': 'normal',
    'font-style': 'normal'
}, {
    'font-family': 'Dancing Script',
    src: `data:@file/x-font-ttf;base64,`,
    'font-weight': 'normal',
    'font-style': 'normal'
}, {
    'font-family': 'Architects Daughter',
    src: `data:@file/x-font-ttf;base64,`,
    'font-weight': 'normal',
    'font-style': 'normal'
}, {
    'font-family': 'Anton Regular',
    src: `data:@file/x-font-ttf;base64,`,
    'font-weight': 'normal',
    'font-style': 'normal'
}];

(function() {
    let css = `<style rel="stylesheet">`;
    for (const font of _fonts) {
        css += `@font-face {
            font-family: '${font['font-family']}';
            src: url('${font.src}') format('truetype');
            font-weight: ${font['font-weight']};
            font-style: ${font['font-style']};
        }`;
    }

    document.head.innerHTML += `${css}</style>`;

    let html = '';
    for (const font of _fonts) {
        html += `<option value="${font['font-family']}" style="font-family: ${font['font-family']};">${font['font-family']}</option>`;
    }

    $('#fontSelector').html(html);
})();